/* eslint-disable jsx-a11y/img-redundant-alt */
import React from "react";
import { useRouteMatch, Switch, Route, useParams } from "react-router-dom";
import Search from "../components/Search";
import { useStateValue } from "../StateProvider";
import response from "../store/response"; // Import the response data directly
import "./SearchPage.css";

function SearchPage() {
  const [{ term }, dispatch] = useStateValue();

  const { path } = useRouteMatch();

  // Use the data from response directly
  const data = response;

  console.log(data);
  return (
    <div className="searchPage">
      {/* Header */}
      <div className="searchPage_header">
        {/* ... (rest of the header code) */}
      </div>
      {/* Routing header options */}
      <Switch>
        <Route exact path={path}>
          {/* Results */}
          {term ? (
            <div className="searchPage_results">
              <p className="searchPage_resultsCount">
                About {data?.searchInformation.formattedTotalResults} results (
                {data?.searchInformation.searchTime} seconds) for {term}
              </p>
              <div className="searchPage_resultsContainer">
                <div className="searchPage_resultsColumn">
                  {/* Render the left column */}
                  {data?.items.slice(0, data.items.length / 2).map((item) => (
                    <div className="searchPage_result" key={item.link}>
                      {/* ... (rest of the result item code) */}
                      <a href={item.link} className="searchPage_resultLink">
                        {/* Show image if it is there */}
                        {item.pagemap?.cse_image?.length > 0 &&
                          item.pagemap?.cse_image[0].src && (
                            <img
                              src={item.pagemap?.cse_image[0].src}
                              alt="result image"
                              className="searchPage_resultImage"
                            />
                          )}
                        {item.displayLink}
                      </a>
                      <a href={item.link} className="searchPage_resultTitle">
                        <h3>{item.title}</h3>
                      </a>
                      <p className="searchPage_resultSnippet">{item.snippet}</p>
                    </div>
                  ))}
                </div>
                <div className="searchPage_resultsColumn">
                  {/* Render the right column */}
                  {data?.items.slice(data.items.length / 2).map((item) => (
                    <div className="searchPage_result" key={item.link}>
                      {/* ... (rest of the result item code) */}
                      <a href={item.link} className="searchPage_resultLink">
                        {/* Show image if it is there */}
                        {item.pagemap?.cse_image?.length > 0 &&
                          item.pagemap?.cse_image[0].src && (
                            <img
                              src={item.pagemap?.cse_image[0].src}
                              alt="result image"
                              className="searchPage_resultImage"
                            />
                          )}
                        {item.displayLink}
                      </a>
                      <a href={item.link} className="searchPage_resultTitle">
                        <h3>{item.title}</h3>
                      </a>
                      <p className="searchPage_resultSnippet">{item.snippet}</p>
                    </div>
                  ))}
                </div>
              </div>
            </div>
          ) : (
            <div className="searchPage_results emptyMessage">
              Please type something in the search box to search something.
            </div>
          )}
        </Route>
        <Route path={`${path}/:optionId`}>
          <Option />
        </Route>
      </Switch>
    </div>
  );
}

export default SearchPage;

function Option() {
  // The <Route> that rendered this component has a
  // path of `/Search/:optionId`. The `:optionId` portion
  // of the URL indicates a placeholder that we can
  // get from `useParams()`.
  let { optionId } = useParams();

  return (
    <div>
      <h3>{optionId}</h3>
    </div>
  );
}
